import React from 'react'
import './Header.scss'
import { motion } from 'framer-motion'

const Header = () => {
  return (
    <div className='container'>
      <motion.div
        className="box"
        whileInView={{
          scale: [1, 1.5, 1.5, 1],
          rotate: [0, 0, 180, 180],
          borderRadius: ["0%", "0%", "50%", "50%"]
        }}
        transition={{
          duration: 2,
          ease: "easeInOut",
          times: [0, 0.2, 0.5, 0.8],
          delayChildren: 0.5
        }}
      >
        <motion.div
          className="box_black"
          whileInView={{
            scale: [1, 1.5, 1.5, 1],
            rotate: [0, 0, 180, 180, 0],
            borderRadius: ["0%", "0%", "50%", "50%", "0%"]
          }}
          transition={{
            duration: 2,
            ease: "easeInOut",
            times: [0, 0.2, 0.5, 0.8, 1],
          }}
        >
        </motion.div>
      </motion.div>
    </div>
  )
}

export default Header

